    false,nt"url": null,nt"notes": "The core function of the Resource Assessment
    and Conservation Engineering (RACE) Groundfish Assessment Program (GAP) is to conduct
    quantitative fishery surveys and related ecological and oceanographic research to
    measure and describe the distribution and abundance of commercially important fish
    and crab stocks in the eastern Bering Sea, Aleutian Islands, Gulf of Alaska.  As
    part of the quality control and general documentation of these efforts, digital
    photographs are taken during each of the surveys.  These photos are stored on an
    AFSC server as .jpg files.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
